__ht__function(data, gv, cache, inputs) {if(!inputs || inputs == '') return false;
function isValidUsername(username) {
    // 正则表达式说明：
    // ^：开始位置
    // [a-zA-Z0-9_]：匹配英文字符、数字或下划线
    // (?:(?![\u4e00-\u9fa5\s@，。、！？【】“”‘’（）《》；：‘’“”…—～·])[\u4e00-\u9fa5a-zA-Z0-9_])+：匹配除指定特殊字符（包括中文标点符号、空格、@）外的字符，至少一次
    // $：结束位置
    // 上述正则表达式中，(?![\u4e00-\u9fa5\s@，。、！？【】“”‘’（）《》；：‘’“”…—～·]) 是一个否定向前查找断言，用于排除指定的特殊字符。
    // const pattern = /^[a-zA-Z_][a-zA-Z0-9_]*(?:(?![\u4e00-\u9fa5\s@，。、！？【】“”‘’（）《》；：‘’“”…—～·])[\u4e00-\u9fa5a-zA-Z0-9_]){5,}$/;
    const pattern = /^[a-zA-Z0-9_][a-zA-Z0-9_]{5,}$/;

    // 使用test方法测试字符串是否符合正则表达式的规则
    return pattern.test(username);
}
// // 示例使用
// console.log(isValidUsername('user_name1')); // true，满足条件
// console.log(isValidUsername('user name')); // false，含有空格
// console.log(isValidUsername('user@name')); // false，含有@
// console.log(isValidUsername('user，name')); // false，含有中文逗号

return !isValidUsername(inputs);}

